def generate_beautiful_points(n, circles):

    def f(x):
        if x == n:
            return '0'
        if x == 0:
            return '(' + str(X[0]) + '+' + f(1) + ')'
        ss = '(abs((t-' + str(x - 1) + '))-abs((t-' + str(x) + ')))'
        tmp = (X[x] - X[x - 1]) // 2
        re = X[x] - X[x - 1] - 2 * tmp
        X[x] += re
        if tmp < 0:
            tmp = '(0' + str(tmp) + ')'
        ss = '((' + str(tmp) + '*' + ss + ')' + '+' + str(tmp) + ')'
        return '(' + ss + '+' + f(x + 1) + ')'
    X = [circle[0] for circle in circles]
    Y = [circle[1] for circle in circles]
    f_t = f(0)
    X = Y
    g_t = f(0)
    return (f_t, g_t)

